        <div className="grade_form">
            <div className="grade_title">Начален етап</div>
            <div className="grade_number_form">
                {
                    initial.map(({grade})=>(
                        <div className="grade_number"
                             onClick={()=>openModal(grade)}
                              // to={`${window.location.pathname}/${grade}`}
                        >
                            {grade}. клас
                        </div>

                    ))
                }
            </div>
        </div>
    );
};

